import Vue from 'vue';
import App from './App.vue';
import VueRouter from 'vue-router';
import PostComponent from './components/PostComponent'

Vue.config.productionTip = false;

Vue.use(VueRouter);

const routes = [
  {
    path: '/api/posts', component: PostComponent
  }
];

const router = new VueRouter({
  routes
});

new Vue({
  render: h => h(App),
  router,
}).$mount('#app')
